    <script>
        function chkHistoryPattern(arr) {
            let result = false

            for (let i = 0; i < arr.length; i++) {
                sp = arr[i].split('?')
                if (sp.length > 1) {
                    sp = sp[1].split('&')
                    for (let j = 0; j < sp.length; j++) {
                        if (sp[j] == 'unlockeq') {
                            result = true
                            break
                        }
                    }
                    if (result) {
                        break
                    }
                }
            }
            return result
        }

        function readCookieCfg() {
            var sp = document.cookie.split(';')
            for (let i = 0; i < sp.length; i++) {
                var sp2 = sp[i].trim().split('=')
                if (sp2.length > 1) {
                    if (sp2[0] == 'url_visited') {
                        try {
                            ret = JSON.parse(sp2[1])
                            return ret
                        }
                        catch{
                            return []
                        }
                    }
                }
            }
            return []
        }

        function writeCookieCfg(cfg) {
            document.cookie = "url_visited=" + JSON.stringify(cfg)
        }


        var url_visited = readCookieCfg()

        url_visited.push(window.location.href)
        while (url_visited.length > 16) {
            url_visited.shift()
        }
        writeCookieCfg(url_visited)
        window.extraContentUnlocked = chkHistoryPattern(url_visited)
    </script>
